function arrayChange(a) {
    let count = 0;
    for (let i = 0; i < a.length - 1; i++) {
        if (a[i] >= a[i + 1]) {
            let diff = a[i] - a[i + 1] + 1;
            a[i + 1] += diff;
            count += diff;
        }
    }
    return count;
}
